//       <Route index={true} path="/" element={<HomeScreen />} />
//     </Route>
//   )
// );

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <RouterProvider router={<HomeScreen />} />
  </React.StrictMode>
);

reportWebVitals();
